import React from 'react';

function SourceCode({slides}) {
    // JSX: JavaScript XML
    return <pre>
        {slides.map((slide) => {
            return <div className='code fade' id={slide.idSlide} name={slide.text} dangerouslySetInnerHTML={{ __html: slide.code }}/>
        })}
        </pre>;
}

export default SourceCode;
